import React, { Component } from 'react';

const Login = () => {
    return ( <div className="container">
        <div className="row justify-content-center" >
            <div className="col-md-4">
                <span style="font-size : 16px">Login</span>

            </div>
        </div>
    </div> );
}
 
export default Login;
